(function(){'use strict';var checkInterval;checkInterval=setInterval(function(){var checkoutContainer=document.getElementById('checkoutSteps'),steps,loaderContainer;if(!checkoutContainer){return;}
steps=checkoutContainer.getElementsByTagName('li');if(steps&&steps.length>0){clearInterval(checkInterval);loaderContainer=document.getElementById('checkout-loader');if(loaderContainer&&loaderContainer.parentNode){loaderContainer.parentNode.removeChild(loaderContainer);}}},100);})();